import "./circle.css";
function Circle(){
    return(
        <div className="set-pack">
            <div className="outer-circle">
                <div className="inner-circle">
                    <a href="#"><h2>Learn More</h2></a>
                </div>
            </div>
        </div>
    )
}
export default Circle;
